const inPlaybackGain = op.inFloatSlider("Playback Gain", 1);
const inLoop = op.inBool("Loop Playback", false);
op.setPortGroup("Playback", [inStartPlayback, inStopPlayback, inLoop, inClearBuffer, inPlaybackGain]);
